INSERT INTO `dotp_acquisition_planning` VALUES (2,2,'Notebook','Preço fixo','Especificação técnica: Dell Inspiron; Polegadas: 14; Processador: Intel Core i5 1.7 GHz; Memoria RAM: 4096 MB; HD: 1024 GB.\r\n','Entrega no prazo (Peso: 1) <br />Aderência à  especificação técnica (Peso: 2) <br />Custo do produto (Peso: 4) <br />','O produto precisa ser entregue na sede da organização<br />Produto com garantia mínima de 1 ano<br />Prazo de entrega inferior a 30 dias úteis<br />','1. Solicitação de orçamento; \r\n2. Avaliação da proposta;\r\n3. Solicitação de compra do produto; \r\n4. Acompanhamento do prazo de entrega;\r\n5. Verificação das especificações do produto recebido; \r\n6. Recebimento da nota fiscal do produto, recibo de entrega, e de seu comprovante de garantia.','Fornecedor: envia orçamento, encaminha o produto para entrega<br />Distribuidor: entrega o produto no local especificado<br />Técnico em informática: verifica as especificações do produto recebido<br />Gerente: solicita a aquisição de acompanha o prazo de entrega<br />Responsável Financeiro: realiza o pagamento<br />'),(4,2,'Web Design','Preço fixo','O trabalho a ser realizado inclui o desenvolvimento dos seguintes itens:\r\n1) Desenvolvimento das telas de Registro de pedido de pizza pelo cliente e Consulta de pedidos realizados. \r\n2) Alinhamento das telas desenvolvidas com a identidade visual da pizzaria. \r\n','Formação profissional (Peso: 2) <br />Custo/hora do profissional (Peso: 4) <br />Disponibilidade (Peso: 1) <br />','O serviço deve ser concluído até 23/05, quando as telas serão integradas com os outros módulos do sistema.<br />O serviço deve ser prestado dentro da organização, em horário comercial, das 9h às 18h, de segunda a sexta. <br />','1. Solicitação de orçamento;\r\n2. Avaliação da proposta recebida;\r\n3. Confirmação da proposta; \r\n4. Alocação dos recursos contratados;\r\n5. Acompanhamento do serviço prestado. \r\n6. Pagamento das horas trabalhas e materiais utilizados;\r\n7. Encerramento do contrato.\r\n','Profissional contratado: envia orçamento, realiza as atividades para as quais foi designado<br />Gerente do projeto: define e gerencia o trabalho a ser realizado<br />Responsável financeiro: realiza o pagamento dos horas trabalhadas e materiais utilizados<br />'),(6,2,'Dispositivo Mobile','Preço fixo','Especificação técnica: Xperia Z3; dimensões 146 x 72 x 7,4 mm; bateria: 3100 mAh; display:  5,2 Full HD (1920 x 1080 pixels)','Realiza a entrega no prazo (Peso: 1) <br />Aderência à especificação técnica (Peso: 2) <br />Custo do produto (Peso: 4) <br />','Produto com garantia mínima de 1 ano<br />Prazo de entrega inferior a 15 dias úteis<br />','1. Solicitação de orçamento;\r\n2. Avaliação da proposta; \r\n3. Solicitação de compra do produto; \r\n4. Acompanhamento do prazo de entrega; \r\n5. Verificação das especificações do produto recebido; \r\n6. Recebimento da nota fiscal do produto, recibo de entrega, e de seu comprovante de garantia.','Fornecedor: envia orçamento, encaminha o produto para entrega<br />Distribuidor: entrega o produto no local especificado<br />Técnico em informática: verifica as especificações do produto recebido<br />Gerente: solicita a aquisições de acompanha o prazo de entrega<br />Responsável Financeiro: realiza o pagamento<br />'),(9,2,'Servidor de aplicação para testes','Preço fixo','Especificação técnica: \r\nProcessador: Intel Core i5 1.7 GHz; \r\nMemoria RAM: 42 GB;\r\nHD: 2TB.','Realiza entrega no prazo (Peso: 1) <br />Aderência à especificação técnica (Peso: 3) <br />Custo do produto (Peso: 2) <br />','Produto com garantia mínima de 1 ano<br />Prazo de entrega em até 1 mês da realização do pedido<br />','1. Solicitação de orçamento;\r\n2. Avaliação da proposta; \r\n3. Solicitação de compra do produto; \r\n4. Acompanhamento do prazo de entrega; \r\n5. Verificação das especificações do produto recebido; \r\n6. Recebimento da nota fiscal do produto, recibo de entrega, e de seu comprovante de garantia.','Fornecedor: envia orçamento, encaminha o produto para entrega<br />Distribuidor: entrega o produto no local especificado<br />Técnico em informática: verifica as especificações do produto recebido<br />Gerente: solicita a aquisições de acompanha o prazo de entrega<br />Responsável Financeiro: realiza o pagamento<br />'),(10,2,'Máquina de café expresso','Preço fixo','Especificação técnica:\r\nCompatibilidade com capsulas Nespresso; \r\nVoltagem: 220 volts\r\nCapacidade de água: mínimo 1 litro.\r\n','Entrega no prazo (Peso: 2) <br />Custo do produto (Peso: 1) <br />Aderência à especificação técnica (Peso: 2) <br />','Produto com garantia mí­nima de 1 ano<br />Prazo de entrega em até 7 dias úteis da realização do pedido<br />Capsulas de café com custo inferior à R$ 2,00<br />','1. Solicitação de orçamento;\r\n2. Avaliação da proposta; \r\n3. Solicitação de compra do produto; \r\n4. Acompanhamento do prazo de entrega; \r\n5. Verificação das especificações do produto recebido; \r\n6. Recebimento da nota fiscal do produto, recibo de entrega, e de seu comprovante de garantia.','Fornecedor: envia orçamento, encaminha o produto para entrega<br />Distribuidor: entrega o produto no local especificado<br />Técnico em informática: verifica as especificações do produto recebido<br />Gerente: solicita a aquisições de acompanha o prazo de entrega<br />Responsável Financeiro: realiza o pagamento<br />'),(12,2,'HD externo','Preço fixo','Capacidade de 1TB.\r\nConexão por USB 3.0.','Custo do produto (Peso: 2) <br />Marca (fabricante) (Peso: 1) <br />','Garantia de 1 ano<br />Fornecedor local<br />','1. Solicitação de orçamento;\r\n2. Avaliação da proposta; \r\n3. Solicitação de compra do produto; \r\n4. Acompanhamento do prazo de entrega; \r\n5. Verificação das especificações do produto recebido; \r\n6. Recebimento da nota fiscal do produto, recibo de entrega, e de seu comprovante de garantia.','Fornecedor: envia orçamento, encaminha o produto para entrega<br />Distribuidor: entrega o produto no local especificado<br />Técnico em informática: verifica as especificações do produto recebido<br />Gerente: solicita a aquisições de acompanha o prazo de entrega<br />Responsável Financeiro: realiza o pagamento<br />'),(13,2,'Aluguel de cloud','Preço fixo','Memória RAM 2GB.\r\nEspaço de armazenamento: 50GB.\r\nServidor Linux CentOS v7.0.','Custo do produto (Peso: 1) <br />Confiabilidade do serviço (Peso: 2) <br />','O serviço precisa de disponibilidade de ao menos 90% do tempo.<br />','1. Contratante acessa sistema do serviço de cloud e solicita o orçamento dadas as configurações do ambiente.\r\n2. Fornecedor apresenta o orçamento.\r\n3. Contratante realiza o pagamento.\r\n4. Fornecedor disponibiliza o ambiente conforme o solicitado.','Fornecedor: Entrega o servidor em cloud, e disponibiliza meios para gerenciar seu acesso.<br />Contratante: Configura o ambiente a ser contratado, e realiza o pagamento pelo serviço.<br />'),(14,2,'Seguro para dispositivos móvel e notebooks','Preço fixo','Apolice de seguros','Menor valor (Peso: 2) <br />Menor franquia (Peso: 1) <br />','O seguro deve entregar um dispositivo idêntico ao furtado ou valor equivalente para compra de um novo dispositivo.<br />','1. O segurado entre em contato com o corretor de seguros e solicita um orçamento.\r\n2. O corretor de seguros indica qual seguradora tem a melhor proposta.\r\n3. O segurado contrata a seguradora por intermédio do corretor de seguros.\r\n4. A seguradora fica disponível para ressarcir o dano quando invocada.','Segurado: Realiza o pagamento do seguro, e invoca quando houver necessidade.<br />Segurador: Reembolsa o segurado quando comprovado o dano, mediante ao pagamento da franquia.<br />Corretor de seguros: Faz a pesquisa de qual seguradora apresenta melhor proposta, e intermedia o pagamento.<br />'),(15,2,'Treinamento em programação para mobile','Tempo & material','Ementa do treinamento.\r\nCarga horária: 16h\r\nQualificação do instrutor: Já ter ministrado este treinamento ao menos 2 vezes; ter experiência prática no desenvolvimento para mobile.','Menor custo (Peso: 1) <br />Aderência da ementa com as tecnologias adotadas no projeto. (Peso: 2) <br />','O treinamento deve ser realizado em dois dias consecutivos<br />A contratada deve oferecer local para ministrar o treinamento, assim como os materiais utilizados.<br />','1. A contratante demanda a realização do treinamento.\r\n2. A contratada confirma a possibilidade de ministrar o treinamento na data solicitada.\r\n3. A contratante disponibiliza os alunos para participarem do treinamento.\r\n4. A contratada realiza o treinamento em local próprio.\r\n5. A contratante finaliza o pagamento e encerra o contrato.','Contratante: Solicita a prestação do serviço e acompanha sua execução.<br />Contratada: Realiza o treinamento na data prevista, disponibilizando local e os materiais necessários para o treinamento.<br />Alunos: Participam o treinamento<br />'),(16,12,'teste','Preço fixo','','','','',''),(17,12,'Servição','Preço fixo','Declaração','','','','');
