INSERT INTO `dotp_human_resources_role` VALUES (1,'Gerente de projetos','Pode alocar os membros da equipe nas atividades que desejar, e tambêm pode solicitar aquisição dos materiais e serviços essenciais para o trabalho.','Elaborar o termo de abertura do projeto.\r\nElaborar o plano do projeto.\r\nExecutar o plano do projeto.\r\nMonitorar e controlar o projeto.\r\nEncerrar formalmente o projeto.','Deve possuir treinamento na área de gerência de projetos e preferencialmente ser certificado PMP.',1),(2,'Programador','Requisitar as ferramentas de software e hardware necessárias para execução de seu trabalho. Solicitar treinamento quando alocado para uma atividade a qual não possui competência.','Executar as atividades do projeto as quais foi alocado. Realizar testes de unidade e integração nos componentes de software os quais está trabalhando.','Formação completa em cursos superior de Ciência da Computação ou Sistemas de Informação. Possuir certificações nas linguagens de programação as quais foi alocado.',1),(3,'Programador TCE','','ddddddd','',2),(4,'Analista TCE','','sss','',2),(5,'Analista de teste','Exigir a execução dos testes antes de qualquer entrega.','Escrever os casos de teste. Executar os testes de sistema e de usabilidade, e acompanhar o cliente na execução dos testes de aceite.','Formação em curso superior em Ciência da Computação ou Sistemas da Informação.',1),(6,'Analista de sistemas','Agendar reuniões com o cliente sempre que necessário. Definir tecnologias apropriadas para construção do produto, respeitando as restrições impostas pelo cliente.','Realizar reuniões junto aos clientes para reconhecimento do negócio.\r\nModelar o negócio do cliente e identificar requisitos de software que suportem uma solução apropriada.\r\nModelar a solução e apresenta-la à  equipe e ao cliente. Validar requisitos e modelos de sistema junto ao cliente.','Formação em Ciência da Computação ou Sistemas da Informação.\r\nEntendimento de modelagem de sistemas. Certificação em UML é desejável.',1),(7,'Gerente da qualidade','Denunciar não conformidades do processo ou do produto ao gerente de projetos.','Executar auditorias internas de acordo com as especificações das normas adotadas pela organização. \r\nBuscar discrepâncias entre o processo executado e o processo definido.\r\nRealiza inspeções nos componentes de software desenvolvidos pela organização, e confere seu suporte/desempenho em relação à especificação.','Graduação de nível superior em alguma área da tecnologia da informação. Conhecimento sobre os modelos de maturidade e capacidade de software.',1),(8,'Project Manager','Allocate team members in project activities.\r\nRequest acquisitions of items necessary to the project.\r\nDismiss team members.','Develop the project plan.\r\nGet the project plan approved by project sponsor.\r\nSelect the project team.\r\nControl the project work.','Interpersonal abilities.\r\nGeneral knowledge in the project application area.\r\nProject Management knowledge.',4),(9,'Programmer','Ask for questions when something related to his duties are not properly documentted.','Perform the coding of request use cases.\r\nAnswer the about effort estimations when requested by the project manager.\r\nCarry out the unit testes of his developments.','Proficiency on JAVA programming language.\r\nKnowledghe on Software Engenerring including:\r\n- Project life cycle.\r\n- UML documentation.\r\n- Software testesing',4),(10,'System Analyst','','Document the project requirements.\r\nDesign the software solution.','',4),(11,'X',NULL,NULL,NULL,3),(12,'Aluno','','','',29),(13,'Orientadora','','','',29),(14,'membro de banca','','','',29),(15,'Auditor externo','Acesso aos documentos e artefatos do projeto. \r\nEntrevistar membros da equipe e o gerente do projeto.\r\nReportar a conformidade do processo seguido no projeto conforme estabelecido no plano da qualidade.','Realizar a controle da qualidade do processo conforme definido no plano de qualidade do projeto.','Conhecimento sobre o MPS.BR e o MA.MPS.',1),(16,'Instrutor','Encerrar o treinamento, elaborar e distribuir o material do treinamento.','Realizar treinamento de sistemas para seus respectivos usuários.','Domínio em técnicas de oratória, conhecimento técnico em TI, elaboração de materiais instrucionais (tais como slides e manuais).',1),(17,'Programador',NULL,NULL,NULL,39),(18,'Analista de teste',NULL,NULL,NULL,39),(21,'teste','B','A','C',5);
