INSERT INTO `dotp_initiating` VALUES (1,'Sistema de pizzaria do Tio Chico',2,1,'2015-07-21 21:34:23','A empresa UniSoft está atuando a um ano na indústria de software da Ilha do Silício, e busca ampliar sua carteira de clientes, possibilitando uma rentabilidade que viabilize seu crescimento de forma sustentável. Uma maneira de se aproximar deste objetivo é pela realização de projetos de software demandados por clientes da região. Neste contexto, a empresa - Pizzaria do Tio Chico - apresentou interesse em investir em um projeto de software para apoiar a realização de pedidos de pizzas. Com a execução deste projeto a empresa UniSoft pode aumentar seu portfólio de produtos (visando empresas com demandas similares), e aumentar sua popularidade na indústria de software da região, auxiliando na encomenda por novos projetos.','Desenvolver uma solução de software, envolvendo um sistema web para que clientes da pizzaria possam solicitar o pedido de pizzas por meio do web site da pizzaria, e um aplicativo mobile para ser acessado pelos smartphones dos entregadores da pizzaria, possibilitando a verificação dos detalhes da entrega (endereço, valor total, troco, telefone do cliente, etc.).','- Módulo web para a encomenda de pizzas.\r\n- Módulo web para controle de pizzas encomendadas.\r\n- Módulo web para cadastro de clientes.\r\n- Módulo mobile para controle de pizzas encomendadas.\r\n- Instalação do sistema web no servidor escolhido pela empresa.\r\n- Treinamento dos funcionários da pizzaria.','- Serão utilizadas ferramentas como IDEs e Case tools gratuítas.\r\n- O orçamento do projeto deve incluir recursos para aquisição de todos os equipamentos necessários para o desenvolvimento (notebooks, celulares/smart phones, servidor).\r\n- O orçamento do projeto deve incluir recursos para custerar despesas de escritório, como aluguel de sala e internet.','- Os resultados devem ser entregues em até 8 meses. \r\n- O sistema precisa ser integrado no site existente da pizzaria e seguir a identidade visual da pizzaria nos módulos web e mobile.',110000,'2017-02-01','2017-08-01','- Módulo do sistema web: 20/06/2017 \r\n- Módulo para celular (aplicativo mobile) para controle de pizzas encomendadas: 01/07/2017\r\n- Treinamento dos funcionários da pizzaria: 18/07/2017\r\n- Instalação do sistema web no servidor escolhido pela empresa: 29/07/2017','- Sistema instalado no ambiente produtivo.\r\n- Custo total não deve ultrapassar o orçamento. \r\n- Atendentes e entregadores treinados para operar o sistema.',0,0,0,'','',2),(2,'Melhoria da usabilidade do dotProject',6,1,'2016-02-03 20:43:58','teste','','TCC','','',0,'2015-01-05','2016-02-03','','',1,1,1,'','',1),(3,'Projeto - módulo de feedback',2,1,'2016-02-08 11:42:37','teste','','Documento do TCC.','','',1000,'2016-02-08','2016-02-08','','',0,0,1,'','',4),(4,'teste feedback',7,1,'2016-02-19 20:16:02','','','','','',0,'2016-02-19','2017-03-30','','',0,0,1,'','',5),(5,'teste feedback',0,11,'2016-03-09 06:44:05','teste','','','','',0,'2016-03-09','2016-03-09','','',0,0,0,'','',7),(6,'Pizza System - Uncle Chico',13,12,'2016-03-14 02:42:43','The Uncle Chico pizza is located in Downtown of Silicio\'s Island. In the east side of this islad there is an ascendent demand for pizzas, and the Uncle Chico wants to meet this demand.','Develop a computational system, available for web and mobile access, which customers my request some pizza, and the deliveres may search the requests content, such as the customer address and requested items.','- Web module.\r\n- Mobile module.\r\n- Tranning of Uncle Chico employees.','Uncle Chico will provide all necessary hardware, such as mobile phones and computers.','The system may be delivered in the begin of the first semester.',48765,'2016-03-14','2016-09-01','- Delivery of web module.\r\n- Delivery of mobile module.','Be completed developed until de deadline, and not overrun the budget. d',1,1,1,'bla','bla',8),(7,'teste feedback',15,1,'2016-04-01 00:44:30','eDUCAÇÃO','','','','',0,'