INSERT INTO `dotp_projects` VALUES (2,1,0,0,'Sistema de pizzaria do Tio Chico','Unidade In',2,'','','2017-02-01 00:00:00','2017-08-01 00:00:00',2,2,'FFFFFF','O objetivo deste projeto é desenvolver um sistema para a venda online de pizzas por meio do website da pizzaria do Tio Chico, incluindo um módulo para dispositivos móveis que suporte a verificação dos detalhes das vendas.\r\n\r\nO escopo deste projeto inclui um módulo web, que abrange a evolução do site da pizzaria para agregar a funcionalidade de venda de pizzas. Para isto o sistema deve manter o cadastro dos clientes, e possibilitar a autenticação dos mesmos. O processo de venda de pizzas deve suportar que sejam informados a quantidade de pizzas, e seus respectivos sabores e tamanhos, além da forma de pagamento. Este módulo deve apresentar o valor final da venda ao cliente, incluindo a taxa de entrega. Outra parte do módulo web será acessível apenas aos atendentes, possibilitando a consulta das vendas realizadas.\r\n\r\nUma segunda parte do sistema é um módulo para dispositivos móveis, que será utilizado pelos entregadores, possibilitando a consulta dos detalhes das vendas (p. ex: endereço de entrega, itens pedidos, telefone do cliente, valor total, troco). No escopo do projeto está incluso a realização de treinamento aos atendentes da pizzaria, para capacita-los nos conhecimentos em informática, e instruí-los quanto à utilização do sistema. Também está incluso a instalação do aplicativo em servidor web produtivo (integrado ao site da pizzaria), e nos dispositivos móveis.\r\n\r\nOs critérios de aceite são:\r\n\r\na) o sistema instalado em ambiente produtivo, tanto na web (integrado ao site da pizzaria), quanto nos dispositivos móveis (3 dispositivos);\r\nb) treinamento realizado de acordo coma carga horária prevista (16 horas), incluindo tanto o módulo web, quanto o módulo para dispositivos móveis;\r\nc) data de entrega e valor final do projeto dentro do orçamento e prazo acordados.\r\n\r\nAs entregas previstas durante o projeto são:\r\n\r\na) Módulo do sistema web: agregando ao site funcionalidades para venda de pizzas, cadastro e autenticação de clientes, e consulta das vendas;\r\nb) Módulo para dispositivos móveis: aplicativo que suporte a consulta dos detalhes das vendas ainda não entregues;\r\nc) Sistema instalado, integrado ao site da pizzaria, e aplicativo instalado nos dispositivos móveis.\r\nd) Funcionários da pizzaria treinados.\r\n\r\nEstão fora do escopo deste projeto:\r\n\r\na) O pagamento das vendas não será realizado pelo sistema. O sistema apenas apresenta o valor total da venda, incluindo a taxa de entrega, e possibilitando o cliente informar a forma de pagamento e o troco necessário.\r\nb) A portabilidade entre dispositivos móveis será restrita aos dispositivos que utilizem o sistema operacional Android. O módulo para dispositivos móveis não será suportado em dispositivos com outros sistemas operacionais, como, por exemplo, iOS e Windows Phone. \r\n\r\nAs restrições que o projeto deverá atender são:\r\n\r\na) a data de entrega do sistema deve ocorrer antes do dia 1 de setembro de 2017;\r\nb) O orçamento não deve ultrapassar R$ 110.000,00;\r\nc) A interface gráfica do módulo web e do módulo para dispositivos móveis devem seguir a identidade visual da pizzaria.\r\n\r\nAs premissas para realização do projeto são:\r\n\r\na) O orçamento do projeto deve incluir recursos para aquisição dos equipamentos necessários para seu desenvolvimento (notebooks, dispositivos móveis, servidor).\r\nb) O orçamento do projeto deve incluir recursos para custear as despesas de escritório, como aluguel de sala e internet.\r\nc) Serão utilizadas ferramentas para o desenvolvimento gratuitas, incluindo IDEs e case tools.',110000.00,0.00,1,0,'0','',0,0),(8,4,0,0,'Pizza System - Uncle Chico','Pizza Syst',13,'','','2016-03-14 00:00:00','2016-09-01 00:00:00',2,97,'FFFFFF','This project aims to develop a computional system where customers may request their pizza, and employess may verify these requests when preparing and delivering each request.<br /><br /><br />\r\n<br /><br /><br />\r\nThis system is composed of two main modules:<br /><br /><br />\r\n<br /><br /><br />\r\nWeb module: A web page which customers may inform their requests, selecting the pizza information, such as flavor and size, select the drink, and also inform the address for delivery.<br /><br /><br />\r\n<br /><br /><br />\r\nMobile module: An app acessed from smart phones, which employess may consult the request information when are in field delivering pizzas.',48765.00,0.00,1,0,'0','',0,0),(12,39,0,0,'Projeto de apresentação dinámica do tamanho máximo do título do projeto','projeto gr',51,'','','2017-04-10 00:00:00','2019-04-03 23:59:59',2,0,'FFFFFF','',300.00,0.00,1,0,'0','',0,0),(21,29,0,0,'teste confirmação','teste conf',1,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,1,0,NULL,NULL,0,0),(23,5,0,0,'teste - copia EAP.','teste',1,'','','0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,'FFFFFF','',0.00,0.00,1,0,'0','',0,0),(24,5,0,0,'teste - Dpp','teste',1,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,1,0,NULL,NULL,0,0),(25,5,0,0,'teste - Dpp','teste',17,'','','2017-09-01 00:00:00','2018-09-27 23:59:59',0,0,'FFFFFF','',0.00,0.00,1,0,'0','',0,0),(27,4,0,0,'Projeto ajuste de stakeholder para único nome','teste A',13,'','','2017-05-03 00:00:00','2018-01-31 23:59:59',2,0,'FFFFFF','',45000.00,0.00,1,0,'0','',0,0),(28,4,0,0,'projeto teste 555555555555555','projeto te',13,'','','0000-00-00 00:00:00','0000-00-00 00:00:00',0,0,'FFFFFF','',0.00,0.00,1,0,'0','',0,0),(29,4,0,0,'novo','novo',1,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,1,0,NULL,NULL,0,0),(30,71,0,0,'Projeto A - Grupo 97','Projeto A',97,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,97,0,NULL,NULL,0,0),(31,71,0,0,'Projeto B - Grupo 97','Projeto B',97,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,97,0,NULL,NULL,0,0),(32,69,0,0,'teste','teste',95,NULL,NULL,NULL,NULL,0,0,'FFFFFF',NULL,0.00,0.00,95,0,NULL,NULL,0,0);
