INSERT INTO `dotp_wbs_dictionary` VALUES (79,NULL),(80,NULL),(82,NULL),(83,NULL),(84,NULL),(85,''),(86,''),(87,'Capacitação presencial realizada para instruir os usuários do sistema sobre os procedimentos adequados para operá-lo.'),(88,'Módulo web publicado em servidor web acessível por meio do site da pizzaria.'),(89,'Dispositivos móveis com o aplicativo do módulo mobile instalados.'),(93,'Funcionalidades para consulta de detalhes do pedido. deve prover para cada consulta em aberto informações como a hora de abertura do pedido, o endereço de entrega, e o telefone do cliente.'),(94,'Tela para consulta a pedidos é utilizada pelos atendentes e administradores da pizzaria. Os relatórios apresentam informações dos pedidos ainda em aberto e do histórico de pedidos já realizados.'),(96,'Tela para os clientes se castrarem e realizarem pedidos de pizzas.'),(97,NULL),(98,'Funcionalidade para identificação de usuários por meio de login e senha.'),(99,'Funcionalidades para o cadastro de pedidos diretamente a partir do site. Ele proporciona ao cliente comprar uma ou mais pizzas e escolher seus respectivos sabores e tamanhos.'),(100,'Funcionalidades para o cadastro de clientes é um requisito para que o cadastro de pedidos possa ser efetuado. Todo cliente que deseja realizar um pedido online deve estar cadastrado no sistema. O cadastro envolve a disponibilização de informações do cliente como nome, e-mail, telefone, e endereço.'),(102,'Documento que por meio de diagramas, registra a estrutura e o comportamento esperado para o sistema. '),(103,'Documento das característica do produto, indicando as funcionalidades e as restrições tecnológicas esperadas.'),(104,NULL),(105,NULL),(106,NULL),(107,'Documento composto pelo plano de escopo, tempo, custo, recursos humanos, comunicação, riscos, stakeholders, qualidade, e aquisição.'),(108,'Documentos que registram as aquisições realizadas ao longo do projeto.'),(109,'Relatório que indica a conformidade do projeto com processo estabelecido.'),(110,'Relatório que incia a conformidade do produto.'),(112,'Reuniões periódicas que avaliam os resultados produzidos em relação aos resultados planejados nas perspectivas de tempo, custo, e escopo.'),(114,'Relatório dos aspectos positivos ou negativos do que ocorreram no projeto, os quais podem colaborar para execução de futuros projetos.'),(115,'Documento assinado pelo cliente após a entrega do projeto.'),(158,'A system that suppot customers to perform their requests, and employess to check this requests using mobile phones.'),(159,'All documentation related to project scope and struture.'),(160,'All set of activities and documentation produced to plan and monitor the project during its execution.'),(161,'An integrated document containg the planning for each of the 10 knowledge areas.');
